import * as React from 'react';
import { Card, CardMedia, CardContent, CardActions, CardHeader, Typography, Link } from '@material-ui/core';
import { projectData } from '../data/data';


const Projects = (props) => {
  return (
    <div className='projects' >
      <h1>Some of my recent Projects</h1>
      <div className='projects-container'>
        {projectData.map((data, key) => {
          return (
            <Card className='project-card' key={key}>
              <CardHeader title={data.name}/>
              <CardMedia className="card-image" image="../images/grad.jpg" />
              <CardContent>
                <Typography variant='body1' component='p'>{data.description}</Typography>
              </CardContent>
              <CardActions>
                <Link href={data.link}>Link</Link>
              </CardActions>
            </Card>
          );
        })}
        
      </div>
    </div>
  );
}
export default Projects;
